import { State } from '../../types/state';
import { NameSpace } from '../../consts';

export const getPageCurrent = (state: State):string => state[NameSpace.Process].pageCurrent;

export const getPriceLimits = (state: State) => state[NameSpace.Process].filterPrice;

export const getFilterTypes = (state: State) => state[NameSpace.Process].filterTypes;

export const getFilterStringsCount = (state: State) => state[NameSpace.Process].filterStringsCount;
